&lt;p&gt;Two statements are given followed by three conclusions numbered I, II and III. Assuming the statements to be true, even if they seem to be at variance with commonly known facts, decide which of the conclusions logically follow(s) from the statements.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Statements:&lt;/strong&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;

&lt;p&gt;Some cars are vehicles.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;

&lt;p&gt;No vehicle is a four-wheeler.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Conclusions:&lt;/strong&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;

&lt;p&gt;I. No car is a four-wheeler.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;

&lt;p&gt;II. All four-wheelers are cars.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;
III. Some vehicles are cars.

hn.value:
&lt;p&gt;नीचे दिए गए प्रश्न में दो कथन और उसके बाद I, II और IIIसे अंकित निष्कर्ष दिए गये हैं। आपको दिए गये कथन को सत्य मानना है, भले ही वे ज्ञात तथ्यों से अलग प्रतीत होते हों। सभी निष्कर्षों को पढ़िए और निर्धारित कीजिये कि दिए गये निष्कर्षों में से कौन-सा/से निष्कर्ष ज्ञात तथ्यों को नजरंदाज करने पर कथनों का तार्किक रूप से अनुसरण करता/करते है/हैं।&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;कथन:&lt;/strong&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;

&lt;p&gt;कुछ कारें वाहन हैं।&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;

&lt;p&gt;कोई भी वाहन चार पहिया वाहन नहीं है।&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;निष्कर्ष:&lt;/strong&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;

&lt;p&gt;I. कोई कार चार पहिया वाहन नहीं है।&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;

&lt;p&gt;II. सभी चार पहिया वाहन कार हैं।&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;
III. कुछ वाहन कार हैं।

